from shapely.wkb import loads
from shapely.geometry import MultiPolygon, Polygon

# HEX geometric data
hex_data = ""

# Convert HEX data to WKB format
wkb_data = bytes.fromhex(hex_data)

# Use Shapely to convert WKB data into a geometric object
geometry = loads(wkb_data)

# If the geometry is a MultiPolygon
if isinstance(geometry, MultiPolygon):
    for polygon in geometry.geoms:
        print(list(polygon.exterior.coords))
else:
    # If the geometry is a Polygon
    print(list(geometry.exterior.coords))

